    // d , a, c, b , f , h , g , e

   class VE {

       constructor(){
            this.$events = [];
       }

       $on(eventName , func){
           let o = {
               name : eventName,
               func () {
                   func.apply(this,[...arguments])
               }
           };
           this.$events.push(o);
       }

       $emit(eventName){
           let args = [...arguments].slice(1);
           let obj  = this.$events.find(it=>it.name === eventName);
           obj.func.apply(this,args);
       }

       $off(eventName){

       }

       $once(eventName , func){

       }

   }
